 Aashiqui 2 is a musical love story with       
 Rahul Jaykar (Aditya Roy Kapoor) and Arohi    
 Shirke (Shraddha Kapoor) as the lead          
 characters. Aashiqui 2 takes you through a    
 musical journey of two lovers who go through  
 love and hate, twists and turbulence,         
 success and failure in their lives. Will      
 they accept their success and live life       
 together or do their egos separate them       
 forever??                                     





